import React from "react";
function ButtonUse() {
  return (
    <div>
      <input type="url" id="linkedinUrl" classname="inputs"></input>
      <br></br>
      <button type="button" onclick="myFunction(linkedinUrl)">
        Start
      </button>
    </div>
  );
}
export default ButtonUse;
